import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    { title: "Car Insurance", amount: 232.21, date: new Date(2021, 2, 28) },
    { title: "Hot Dogs", amount: 24.66, date: new Date(2020, 6, 3) },
    { title: "Hot Dogs", amount: 44.37, date: new Date(2020, 6, 3) },
    { title: "Flamingo", amount: 294.67, date: new Date(2021, 8, 18) },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <p>This is also visible!</p>
      <ExpenseItem
        title={expenses[0].title}
        amount={expenses[0].amount}
        date={expenses[0].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expenses[1].title}
        amount={expenses[1].amount}
        date={expenses[1].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expenses[2].title}
        amount={expenses[2].amount}
        date={expenses[2].date}
      ></ExpenseItem>
      <ExpenseItem title={expenses[3].title}
        amount={expenses[3].amount}
        date={expenses[3].date}></ExpenseItem>
    </div>
  );
}

export default App;
